import React from "react";
import { Link } from "react-router-dom";
import { Box, ListItemIcon, Typography } from "@mui/material";
import { useState, useEffect } from "react";
import MenuItem from "@mui/material/MenuItem";
import Menu from "@mui/material/Menu";
import { ExpandMore } from "@mui/icons-material";
import axios from "axios";

function Images() {
  return (
    <div
      style={{
        display: "grid",
        gridTemplateRows: "repeat(3, 1fr)", // change this to gridTemplateRows
        gridGap: "10px",
        margin: "0 auto",
        maxWidth: "800px",
      }}
    >
      <div
        style={{
          backgroundColor: "#ccc",
          height: "200px",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        Box 1
      </div>
      <div
        style={{
          backgroundColor: "#ccc",
          height: "200px",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        Box 2
      </div>
      <div
        style={{
          backgroundColor: "#ccc",
          height: "200px",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        Box 3
      </div>
    </div>
  );
}
export default Images;
